function log(t){DEVELOPMENT&&console.log(`%c[Log] ${t}`,"color: #00a2ff;")}function error(t){console.error(t)}function distance(t,n,e,o){var r=t-n,c=e-o;return Math.sqrt(r*r+c*c)}function random(t,n){return Math.floor(Math.random()*(n-t)+t)}function checkIntersection(t,n,e,o,r,c,i,a){return n>=e&&t<=o&&r<=a&&c>=i}function timestamp(){return(new Date).getTime()/1e3}function mtimestamp(){return(new Date).getTime()}function getLocalStorageObj(t){return JSON.parse(localStorage.getItem(t))}function hide(t){$(t).hide()}function show(t){$(t).show()}
